import React from "react";
import { TextField, MenuItem, ThemeProvider } from "@material-ui/core";
import languages from "../data/languages";
import poSpeech from "../data/poSpeech";

const Inputs = ({ language, setLanguage,poSpeech,setpoSpeech }) => {
  return (
    <div classname="Inputs">
      <TextField id="filled-basic" label="Word" variant="filled" />

      <TextField
        select
        label="Part of Speech"
        value={poSpeech}
        onChange={(e) => setpoSpeech(e.target.value)}
        className="select"
      >
        {poSpeech.map((item) => (
          <MenuItem key={item.label} value={item.label}>
            {item.value}
          </MenuItem>
        ))}
      </TextField>

      <TextField
        select
        label="Language"
        value={language}
        onChange={(e) => setLanguage(e.target.value)}
        className="select"
      >
        {languages.map((item) => (
          <MenuItem key={item.label} value={item.label}>
            {item.value}
          </MenuItem>
        ))}
      </TextField>
    </div>
  );
};
export default Inputs;
